  \"2016-07-15T04:23:31.972157\",\n\t\"name\": \"max-and-survey-linkages-73da0\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>CMS is interested in linking MAX files
  with survey data, including four surveys conducted by the National Center for Health
  Statistics (NCHS) - the National Health Interview Survey (NHIS), the National Health
  and Nutrition Examination Survey (NHANES), the Second Longitudinal Study of Aging
  (LSOA II), and the National Nursing Home Survey (NNHS).  In linking the MAX files
  to the NCHS survey data, CMS can combine the best source of data on Medicaid services
  with the best sources of data on health status and risk factors.  The combined files
  can be extraordinarily valuable to researchers conducting comparative effectiveness
  research as well as to the wider health research community.</p>n\",\n\t\"license_title\":
